// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import "@openzeppelin/contracts/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import './interfaces/IDexPool.sol';

contract DexPool is IDexPool, UUPSUpgradeable, Initializable {
    /// @inheritdoc IDexPool
    address public override factory;
    /// @inheritdoc IDexPool
    address public override token0;
    /// @inheritdoc IDexPool
    address public override token1;
    /// @inheritdoc IDexPool
    uint24 public override fee;

    function initialize() external {}

    function addLiquidity(
        address recipient,
        int24 tickLower,
        int24 tickUpper,
        uint128 amount,
        bytes calldata data
    ) external returns (uint256 amount0, uint256 amount1) {}

    function swap(
        address recipient,
        int256 amountSpecified,
        uint160 sqrtPriceLimitX96,
        bytes calldata data
    ) external returns (int256 amount0, int256 amount1) {}

    function flash(
        address recipient,
        uint256 amount0,
        uint256 amount1,
        bytes calldata data
    ) external {}

    function setFee(uint24 fee) external {}

    function _authorizeUpgrade(address newImplementation)
        internal
        virtual
        override
    {}
}

contracts/interfaces/IDexPool.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

interface IDexPool {
    event FeeChanged(uint24 indexed oldFee, uint24 indexed newFee);

    /// @notice The contract that deployed the pool, which must adhere to the IUniswapV3Factory interface
    /// @return The contract address
    function factory() external view returns (address);

    /// @notice The first of the two tokens of the pool, sorted by address
    /// @return The token contract address
    function token0() external view returns (address);

    /// @notice The second of the two tokens of the pool, sorted by address
    /// @return The token contract address
    function token1() external view returns (address);

    /// @notice The pool's fee in hundredths of a bip, i.e. 1e-6
    /// @return The fee
    function fee() external view returns (uint24);

    function initialize() external;

    function addLiquidity(
        address recipient,
        int24 tickLower,
        int24 tickUpper,
        uint128 amount,
        bytes calldata data
    ) external returns (uint256 amount0, uint256 amount1);

    function swap(
        address recipient,
        int256 amountSpecified,
        uint160 sqrtPriceLimitX96,
        bytes calldata data
    ) external returns (int256 amount0, int256 amount1);

    function flash(
        address recipient,
        uint256 amount0,
        uint256 amount1,
        bytes calldata data
    ) external;

    function setFee(uint24 fee) external;
}

